import React from "react";

function Landing() {
    return(
        <div className="landing">
            <a className="start-anchor" href="javascript:void(0)">Start Game</a>
            <a className="join-anchor" href="javascript:void(0)">Join Game</a>
        </div>
    )
}

export default Landing;
